{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/melissamalekpour/data-analytics-capstone-project-bellabeat?scriptVersionId=162901992\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"12405edd","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.018385,"end_time":"2024-02-14T23:34:41.764076","exception":false,"start_time":"2024-02-14T23:34:41.745691","status":"completed"},"tags":[]},"source":["## Introduction\n","\n","This case study centers on Bellabeat, a wellness technology firm dedicated to creating health-oriented products for women. The primary objective is to analyze data from smart device usage to gain insights into the behaviors of consumers. These insights are intended to guide Bellabeat’s marketing strategies, leveraging trends within smart device utilization by their target demographic. The study covers the full spectrum of the data analysis process, including data preparation, thorough analysis, presentation of findings, and formulation of strategic recommendations. This comprehensive approach illustrates how leveraging data-driven insights can enhance business expansion and marketing efficacy."]},{"cell_type":"markdown","id":"f4b0d09d","metadata":{"papermill":{"duration":0.01779,"end_time":"2024-02-14T23:34:41.799635","exception":false,"start_time":"2024-02-14T23:34:41.781845","status":"completed"},"tags":[]},"source":["## About the Company\n","\n","Bellabeat, a company specializing in the creation of health-oriented technology products for women, stands as a successful, albeit small, entity with the capability to emerge as a more significant competitor in the international smart device market. The company was co-founded by Urška Sršen and Sando Mur, with Sršen leveraging her artistic background to craft technology that is not only aesthetically pleasing but also motivates and educates women globally. Established in 2013, Bellabeat has experienced swift growth, firmly establishing its reputation as a technology-centric wellness brand for women."]},{"cell_type":"markdown","id":"4f9f565a","metadata":{"papermill":{"duration":0.017054,"end_time":"2024-02-14T23:34:41.834262","exception":false,"start_time":"2024-02-14T23:34:41.817208","status":"completed"},"tags":[]},"source":["## Scenario\n","\n","In a theoretical situation, I serve as a junior data analyst on the marketing analysis team at Bellabeat, a company specializing in the development of high-tech, health-oriented products for women. My assignment involves concentrating on one specific product, the Bellabeat app, with the objective of analyzing data from smart devices to uncover patterns in customer usage. The insights derived from my study will be instrumental in shaping Bellabeat’s marketing strategies. I am tasked with compiling my findings and strategic recommendations to present to the Bellabeat executive team."]},{"cell_type":"markdown","id":"2a1a744f","metadata":{"papermill":{"duration":0.017717,"end_time":"2024-02-14T23:34:41.869004","exception":false,"start_time":"2024-02-14T23:34:41.851287","status":"completed"},"tags":[]},"source":["## Characters and Products\n","\n","* **Characters**\n","  + **Urška Sršen**: Bellabeat’s cofounder and Chief Creative Officer\n","  + **Sando Mur**: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","  + **Bellabeat marketing analytics team**: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy. I joined this team six months ago and have been busy learning about Bellabeat’s mission and business goals — as well as how you, as a junior data analyst, can help Bellabeat achieve them.\n","\\\n","* **Products**\n","  + **Bellabeat app**: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","  + **Leaf**: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","  + **Time**: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","  + **Spring**: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","  + **Bellabeat membership**: Bellabeat also offers a subscription-based membership program for users.\n","Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and\n","beauty, and mindfulness based on their lifestyle and goals."]},{"cell_type":"markdown","id":"a05c0cb4","metadata":{"papermill":{"duration":0.016962,"end_time":"2024-02-14T23:34:41.90285","exception":false,"start_time":"2024-02-14T23:34:41.885888","status":"completed"},"tags":[]},"source":["## **1. Phase: Ask**\n","\n","The \"Ask\" phase marks the beginning of our analysis, focusing on formulating essential questions designed to delve into the smart device usage patterns of Bellabeat customers. This foundational step is crucial for uncovering actionable insights and identifying opportunities for growth that the marketing team can leverage.\n","\n","### Business Task\n","The primary goal is to pinpoint patterns in the usage of non-Bellabeat smart devices by consumers. These insights will be integrated into Bellabeat's marketing strategies to enhance its market positioning and consumer engagement.\n","\n","### Stakeholders\n","* Urška Sršen, the co-founder and Chief Creative Officer of Bellabeat, plays a pivotal role in steering the creative direction and product innovation.\n","* Sando Mur, co-founder and a vital member of the executive team, brings analytical and strategic insights into decision-making processes.\n","* The Bellabeat marketing analytics team is responsible for conducting the analysis, extracting valuable insights, and recommending strategies based on consumer behavior trends observed in non-Bellabeat smart device usage."]},{"cell_type":"markdown","id":"4361f5f7","metadata":{"papermill":{"duration":0.016882,"end_time":"2024-02-14T23:34:41.938484","exception":false,"start_time":"2024-02-14T23:34:41.921602","status":"completed"},"tags":[]},"source":["## **2. Phase: Prepare**\n","\n","The \"Prepare\" phase focuses on collecting and preparing the necessary data for analysis, ensuring it is accurate, complete, and ready for in-depth examination to inform Bellabeat's strategic decisions.\n","\n","### Overview of Data Sources Utilized\n","The data source selected for our case study originates from the [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit). This particular dataset is hosted on [Kaggle](https://www.kaggle.com/) and was provided courtesy of [Mobius](https://www.kaggle.com/arashnic).\n","\n","### Information About the Data\n","This dataset was generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. Individual reports can be parsed by export session ID (column A) or timestamp (column B). Variation between output represents use of different types of Fitbit trackers and individual tracking behaviors / preferences.\n","\n","### Structure of the Data\n","The dataset comprises 18 distinct CSV files, each corresponding to different quantitative metrics monitored by Fitbit. This data is organized in a long format, where each row indicates a distinct time point for a given subject, thereby assigning multiple rows to each subject. A unique ID is assigned to every user, facilitating the differentiation of data across various rows, as it is segmented by both date and time.\n","\n","### Data Integrity and Credibility:\n","The dataset, constrained by its small scale and lack of demographic details, may be prone to sampling bias, casting doubt on its representativeness of the general population. The additional challenges of the dataset not being up-to-date and the survey's brief timeframe of 2 months also detract from its comprehensiveness and current applicability. Within the confines of this research, we will proceed utilizing the dataset in its present form. However, in practical applications, it would be advisable to enhance the dataset with newer, more relevant data and, where feasible, to include demographic details.\n","\n","### Data Accessibility and Privacy:\n","An examination of our dataset's metadata confirms its open-source status. The owner has expressly abandoned all rights to the work under copyright law on a worldwide basis, including any adjacent rights, as far as the law permits. Consequently, the work is available for copying, modification, distribution, and use, even commercially, without any requirement for authorization."]},{"cell_type":"markdown","id":"f9b4510e","metadata":{"papermill":{"duration":0.016855,"end_time":"2024-02-14T23:34:41.97219","exception":false,"start_time":"2024-02-14T23:34:41.955335","status":"completed"},"tags":[]},"source":["## **3. Phase: Process**\n","\n","In the \"Process\" phase, the task is to diligently clean and modify the selected dataset, ensuring it is well-organized and uniform for productive analysis. This phase is essential for establishing a strong base that will facilitate the derivation of valuable insights.\n","\n","We will opt for R in this analysis based on its broad accessibility, suitability for handling the expected data volume, and the facility to create compelling data visualizations that will aid in presenting outcomes and suggestions to stakeholders.\n","\n","### Preparing the Environment by Loading Essential Packages\n","For the purpose of this analysis, the following R packages will be loaded due to their relevance and utility in addressing the analytical requirements:\n","\n","* **tidyverse**: Offers a suite of tools for data manipulation, visualization, and exploration, integral for data science in R.\n","* **here**: Facilitates the use of project-oriented workflows by managing file paths in a more intuitive manner.\n","* **skimr**: Enables quick and detailed summaries of datasets, which is critical for preliminary data assessments.\n","* **janitor**: Provides functions that simplify the cleaning of data and column names, enhancing data quality and readability.\n","* **lubridate**: Makes it easier to work with dates and times in R, crucial for analyses involving temporal data.\n","* **knitr**: Allows dynamic reporting in R by enabling integration of R code into LaTeX, LyX, HTML, Markdown, AsciiDoc, and reStructuredText documents.\n","* **kableExtra**: Designed to extend the basic functionality of tables produced using knitr::kable()"]},{"cell_type":"code","execution_count":1,"id":"67dbf1f4","metadata":{"execution":{"iopub.execute_input":"2024-02-14T23:34:42.010411Z","iopub.status.busy":"2024-02-14T23:34:42.008125Z","iopub.status.idle":"2024-02-14T23:34:42.125758Z","shell.execute_reply":"2024-02-14T23:34:42.123789Z"},"papermill":{"duration":0.140245,"end_time":"2024-02-14T23:34:42.129165","exception":false,"start_time":"2024-02-14T23:34:41.98892","status":"completed"},"tags":[]},"outputs":[],"source":["#install.packages(\"tidyverse\")\n","#install.packages(\"here\")\n","#install.packages(\"skimr\"