ps)) +\n","  geom_point() +\n","  geom_smooth() +\n","  labs(title = \"Minutes Asleep vs. Daily Activity\",\n","       x = \"Minutes Asleep\",\n","       y = \"Steps\")"]},{"cell_type":"markdown","id":"43834de2","metadata":{"papermill":{"duration":0.034546,"end_time":"2024-02-14T23:34:57.253688","exception":false,"start_time":"2024-02-14T23:34:57.219142","status":"completed"},"tags":[]},"source":["The \"Total Steps vs. Minutes Asleep\" chart offers several observations:\n","\n","* The relationship between total steps and minutes asleep is not linear. Initially, as the number of steps increases, the minutes spent asleep tend to rise, followed by a slight decrease.\n","* The data indicates that the greatest amounts of sleep are not consistently associated with the highest step counts. This suggests that optimal sleep may be more closely aligned with moderate levels of activity.\n","* The spread of the data points to individual differences in sleep requirements or habits that are not solely dependent on activity levels.\n"]},{"cell_type":"markdown","id":"6abf3844","metadata":{"papermill":{"duration":0.033557,"end_time":"2024-02-14T23:34:57.320844","exception":false,"start_time":"2024-02-14T23:34:57.287287","status":"completed"},"tags":[]},"source":["#### What Patterns Emerge in Intensity Levels Over the Course of a Day?"]},{"cell_type":"code","execution_count":39,"id":"1cbc009e","metadata":{"execution":{"iopub.execute_input":"2024-02-14T23:34:57.392194Z","iopub.status.busy":"2024-02-14T23:34:57.390448Z","iopub.status.idle":"2024-02-14T23:34:57.428313Z","shell.execute_reply":"2024-02-14T23:34:57.426363Z"},"papermill":{"duration":0.076461,"end_time":"2024-02-14T23:34:57.430928","exception":false,"start_time":"2024-02-14T23:34:57.354467","status":"completed"},"tags":[]},"outputs":[],"source":["# Calculate average intensity per hour from hourly_intensities data frame\n","average_intensities_per_hour <- hourly_intensities %>%\n","  # Convert date_time to POSIXct and extract