)"]},{"cell_type":"markdown","id":"4ec4151d","metadata":{"papermill":{"duration":0.037112,"end_time":"2024-02-14T23:34:59.874692","exception":false,"start_time":"2024-02-14T23:34:59.83758","status":"completed"},"tags":[]},"source":["The \"Daily Sleep Minutes per Weekday\" chart indicates:\n","\n","* The duration of sleep remains uniform throughout the week, without significant variance among weekdays.\n","* The majority of days either meet or exceed the CDC's recommended 7 hours of sleep, especially as the week progresses toward the weekend.\n","* The data suggests a regular sleep pattern among participants, with a tendency for slightly extended sleep durations on Sundays."]},{"cell_type":"markdown","id":"49dbb847","metadata":{"papermill":{"duration":0.039117,"end_time":"2024-02-14T23:34:59.950893","exception":false,"start_time":"2024-02-14T23:34:59.911776","status":"completed"},"tags":[]},"source":["#### User Segmentation by Smart Device Usage"]},{"cell_type":"code","execution_count":47,"id":"ae6ea086","metadata":{"execution":{"iopub.execute_input":"2024-02-14T23:35:00.030746Z","iopub.status.busy":"2024-02-14T23:35:00.029071Z","iopub.status.idle":"2024-02-14T23:35:00.050582Z","shell.execute_reply":"2024-02-14T23:35:00.047987Z"},"papermill":{"duration":0.06586,"end_time":"2024-02-14T23:35:00.053887","exception":false,"start_time":"2024-02-14T23:34:59.988027","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["31"],"text/latex":["31"],"text/markdown":["31"],"text/plain":["[1] 31"]},"metadata":{},"output_type":"display_data"}],"source":["n_distinct(merged_daily_activity_sleep$date)"]},{"cell_type":"markdown","id":"011b7957","metadata":{"papermill":{"duration":0.037653,"end_time":"2024-02-14T23:35:00.129893","exception":false,"start_time":"2024-02-14T23:35:00.09224","status":"completed"},"tags":[]},"source":["In the following step, we plan to assess the daily usage of smart devices among our users, categorizing them into three segments based on usage over the 31-day survey period:\n","\n","* **High User:** These are users who engage with their device for 21-31 days.\n","* **Moderate User:** This category includes users who use their device for 10-20 days.\n","* **Low User:** Users falling into this segment use their device for 1-10 days.\n","\n","We will further differentiate between \"daytime usage\" and \"nighttime usage\" by analyzing the daily_activity and daily_sleep records. This approach will enable us to understand patterns of smart device usage during the day compared to the night, providing insights into user behavior and device interaction across different times of the day."]},{"cell_type":"markdown","id":"bf316ffc","metadata":{"papermill":{"duration":0.037271,"end_time":"2024-02-14T23:35:00.204647","exception":false,"start_time":"2024-02-14T23:35:00.167376","status":"completed"},"tags":[]},"source":["##### Daytime Usage:"]},{"cell_type":"code","execution_count":48,"id":"9deadd21","metadata":{"execution":{"iopub.execute_input":"2024-02-14T23:35:00.283259Z","iopub.status.busy":"2024-02-14T23:35:00.281552Z","iopub.status.idle":"2024-02-14T23:35:00.319843Z","shell.execute_reply":"2024-02-14T23:35:00.31745Z"},"papermill":{"duration":0.08106,"end_time":"2024-02-14T23:35:00.323118","exception":false,"start_time":"2024-02-14T23:35:00.242058","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Rows: 33\n","Columns: 3\n","$ id        \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 1503960366, 1624580081, 1644430081, 1844505072, 1927972279, …\n","$ days_used \u001b[3m\u001b[90m<int>\u001b[39m\u001b[23m 31, 31, 30, 31, 31, 31, 31, 31, 18, 31, 20, 30, 31, 4, 31, 3…\n","$ user_type \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"high user\", \"high user\", \"high user\", \"high user\", \"high us…\n"]}],"source":["# Calculate the number of active days for each user and categorize them by usage\n","daytime_daily_use <- daily_activity %>%\n","  group_by(id) %>%\n","  # Summarize the total days used for each user\n","  summarize(days_used = n_distinct(date)) %>%\n","  # Categorize users based on the number of days they used the device\n","  mutate(user_type = case_when(\n","    days_used <= 10 ~ \"low user\",\n","    days_used <= 20 ~ \"moderate user\", \n","    days_used <= 31 ~ \"high user\" \n","  ))\n","\n","# Display a glimpse of the resulting data frame\n","glimpse(daytime_daily_use)"]},{"cell_type":"markdown","id":"d6193584","metadata":{"papermill":{"duration":0.039235,"end_time":"2024-02-14T23:35:00.400313","exception":false,"start_time":"2024-02-14T23:35:00.361078","status":"completed"},"tags":[]},"source":["In the next step, we will create a new data frame that quantifies the percentages of each user type category:"]},{"cell_type":"code","execution_count":49,"id":"630f6c12","metadata":{"execution":{"iopub.execute_input":"2024-02-14T23:35:00.480419Z","iopub.status.busy":"2024-02-14T23:35:00.478629Z","iopub.status.idle":"2024-02-14T23:35:00.532398Z","shell.execute_reply":"2024-02-14T23:35:00.529542Z"},"papermill":{"duration":0.097979,"end_time":"2024-02-14T23:35:00.535951","exception":false,"start_time":"2024-02-14T23:35:00.437972","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 3 × 4</caption>\n","<thead>\n","\t<tr><th scope=col>user_type</th><th scope=col>n</th><th scope=col>total_percent</th><th scope=col>labels</th></tr>\n","\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>high user    </td><td>29</td><td>0.87878788</td><td>87.9%</td></tr>\n","\t<tr><td>low user     </td><td> 1</td><td>0.03030303</td><td>3.0% </td></tr>\n","\t<tr><td>moderate user</td><td> 3</td><td>0.09090909</td><td>9.1% </td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 3 × 4\n","\\begin{tabular}{llll}\n"," user\\_type & n & total\\_percent & labels\\\\\n"," <f