gmAHAABgEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAI\ngh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0A\nAIBFEOwAAAAsgmAHAABgEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBF\nEOwAAAAsgmAHAABgEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwA\nAAAsgmAHAABgEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAs\ngmAHAABgEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAH\nAABgEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABg\nEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7\nAAAAiyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAA\niyDYAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAAiyDY\nAQAAWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAAiyDYAQAA\nWATBDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAAiyDYAQAAWATB\nDgAAwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAAiyDYAQAAWATBDgAA\nwCIIdgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAAiyDYAQAAWATBDgAAwCII\ndgAAABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAA\nABZBsAMAALAIgh0AAIBFEOwAAAAsgmAHAABgEQQ7AAAAiyDYAQAAWATBDgAAwCIIdgAAABZB\nsAMAALAIgh0AAIBFEOwAAAAs4v8BsAd4RVgialQAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Create a pie chart to visualize user types by daily use percentage\n","nighttime_daily_use_percent %>%\n","  ggplot(aes(x = \"\", y = total_percent, fill = user_type)) +\n","  # Draw the pie chart using bars with identity statistics\n","  geom_bar(stat = \"identity\", width = 1) +\n","  # Convert the bar chart to a pie chart\n","  coord_polar(\"y\", start = 0) + \n","  # Apply a minimalistic theme with no background, gridlines, or text\n","  theme_void() +\n","  # Manually set the colors and labels for the fill scale\n","  scale_fill_manual(values = c(\"high user\" = \"#F7CAC9\", \n","                               \"moderate user\" = \"#92A8D1\", \n","                               \"low user\" = \"#98DDDE\"), \n","                    labels = c(\"High user - 21 to 31 days\",\n","                               \"Moderate user - 11 to 20 days\",\n","                               \"Low user - 1 to 10 days\")) +\n","  # Add a title to the plot\n","  labs(title = \"Daily Nighttime Use of Smart Device\") +\n","  # Add text labels to the pie chart\n","  geom_text(aes(label = labels), position = position_stack(vjust = 0.8))"]},{"cell_type":"markdown","id":"b0d0486c","metadata":{"papermill":{"duration":0.040469,"end_time":"2024-02-14T23:35:01.996754","exception":false,"start_time":"2024-02-14T23:35:01.956285","status":"completed"},"tags":[]},"source":["The analyses of \"Daily Daytime Use of Smart Device\" and \"Daily Nighttime Use of Smart Device\" indicate:\n","\n","* **Daytime Usage:** The majority of daytime users are classified as \"high users,\" accounting for 87.9% of the segment. This suggests a significant level of engagement with the devices during daytime hours.\n","* **Nighttime Usage:** The distribution of user types during nighttime is more balanced, with \"high users\" still comprising a notable half of the segment. This indicates a considerable but less pronounced use of devices at night.\n","* **Comparative Engagement:** The pronounced difference in daytime versus nighttime engagement suggests that users tend to interact more actively with their devices during the day. This might be driven by the devices' features that are more applicable to daytime activities, such as activity tracking.\n","* **Implications for Design and Marketing:** These findings underscore a potential area of focus for the company to enhance and promote features that support daytime activities. Additionally, exploring how comfortable and practical it is for users to wear or use smart devices while sleeping could offer insights for improving nighttime usage experiences."]},{"cell_type":"markdown","id":"13514394","metadata":{"papermill":{"duration":0.042325,"end_time":"2024-02-14T23:35:02.079492","exception":false,"start_time":"2024-02-14T23:35:02.037167","status":"completed"},"tags":[]},"source":["## 6. Phase: Act - Strategic Recommendations for Bellabeat's Marketing Strategy\n","In the \"Act\" phase, drawing from the extensive analysis of the fitbit user data, we formulate several strategic recommendations to refine the company's marketing approach:\n","\n","1. **Promote Daytime Activity Engagement:** With 87.9% of users identified as 'high users' during daytime, emphasizing features that support and encourage daytime activity becomes paramount. Enhancing and marketing functionalities such as activity reminders or goal-setting features could significantly boost daytime user engagement.\n","2. **Enhance Sleep Functionality:** Acknowledging that a considerable segment of users achieves or surpasses the CDC’s recommended 7 hours of sleep, especially during the weekend, Bellabeat can capitalize on this by advancing sleep analysis features. These enhancements could offer deeper insights into sleep patterns and personalized suggestions for improving sleep quality.\n","3. **Combat Sedentary Behaviors:** The link between step counts and sedentary minutes uncovers an opportunity for Bellabeat to motivate users towards more active lifestyles. Campaigns or features that nudge users towards movement after prolonged inactivity could address sedentary habits effectively.\n","4. **Leverage User Segmentation in Marketing:** By categorizing users into 'low', 'moderate', and 'high' engagement segments, Bellabeat can craft more personalized marketing messages. This could involve encouraging 'low users' to engage more with their device, while offering 'high users' information on advanced features or community engagement opportunities.\n","5. **Highlight Nighttime Device Comfort and Utility:** Investigating user perceptions of nighttime wearability can inform improvements in device design for enhanced comfort. Marketing efforts could then emphasize the sleep tracking and comfort features of Bellabeat products to encourage nighttime usage.\n","6. **Offer Customized Activity Insights:** Considering the wide variability in user activity levels and metabolic responses, providing personalized activity insights and recommendations could improve user satisfaction. Tailoring this content to fit individual user profiles would make the Bellabeat app more relevant and engaging.\n","\n","Implementing these targeted strategies will enable Bellabeat to address specific user needs and preferences, fostering greater engagement and loyalty to the brand.\n","\n","In summary, it bears repeating that incorporating extra datasets and demographic information is highly recommended for a comprehensive analysis. This strategy not only maintains the relevance of the data but also plays a crucial role in accurately linking behavioral patterns to specific demographic categories. This, in turn, can improve predictive accuracy and enable more precise customization of the marketing strategy."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":1752235,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":24.000382,"end_time":"2024-02-14T23:35:02.242313","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-02-14T23:34:38.241931","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}